import React from 'react';
import ReactDOM from 'react-dom/client';

// Componente principal de la aplicación (temporal)
function App() {
return (
    <div className="App">
    <h1>¡Frontend de Repositorio en Construcción!</h1>
    <p>Si ves esto, el contenedor de Docker del Frontend está funcionando.</p>
    </div>
);
}

// Inicialización de la aplicación
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
<React.StrictMode>
    <App />
</React.StrictMode>
);
